public LinkedInSlots_ComputeCellMetricsBatch(LinkedInSlots coordinator, ...)

if (sourcingPlatforms == null || sourcingPlatforms.size() == 0) {
 throw new IllegalArgumentException('sourcingPlatforms', 'Should have at least one element');
}

for (SourcingPlatform sp : sourcingPlatforms) {
 processed++; // Increment processed count
 this.sourcingPlatformRepo.save(sp);
 this.minLastModified = sp.getLastModified().isBefore(this.minLastModified ? sp.getLastModified() : this.minLastModified;
 this.setInstance(sp.getInstance());
 this.increaseProcessed();
}
